import React from "react";

const api = {
  key: "9c82a2dfa2e9bcf10c838e6083d3128d",
  base: "https://api.openweathermap.org/data/2.5/",
};

function App() {
  return (
    <div className="App">
      <main>
        <div className="search-box">
          <input
            type="text"
            className="search-bar"
            placeholder="Enter a city"
          ></input>
        </div>
      </main>
    </div>
  );
}

export default App;
